void int_repr(int64_t y, char** out_ptr, size_t *out_size) {
    static char c[32] = {0};
    memset(c, 0, 32);
    char* p = c+30;
    size_t n = 0;
    uint64_t x;
    if (y < 0) {
        if (y == INT64_MIN) {
            x = 1+(uint64_t)INT64_MAX;
        } else {
            x = (uint64_t)-y;
        }
    } else {
        x = (uint64_t)y;
    }
    do {
        *--p = '0' + (x % 10);
        x /= 10;
        n++;
    } while (x);
    if (y < 0) {
        *--p = '-';
        n++;
    }
    *out_ptr = p;
    *out_size = n;
}

void int_trace_(int64_t y, int fd) {
    char* p; size_t n;
    int_repr(y, &p, &n);
    write(fd, p, n);
}

void mw_prim_int_to_str(void) {
    PRIM_ENTER(mw_prim_int_to_str,"prim-int-to-str");
    int64_t x = pop_i64();
    bool cache = (0 <= x) && (x <= 255);
    static VAL scache[256] = {0};
    if (cache && scache[x].tag) {
        incref(scache[x]);
        push_value(scache[x]);
    } else {
        char* p; size_t n;
        int_repr(x,&p,&n);
        VAL out = mkstr(p,n);
        push_value(out);
        if (cache) {
            scache[x] = out;
            incref(out);
        }
    }
    PRIM_EXIT(mw_prim_int_to_str);
}

void str_trace_(STR* str, int fd) {
    ASSERT(str->size <= SIZE_MAX);
    write(fd, "\"", 1);
    write(fd, str->data, (size_t)str->size); // TODO handle escapes
    write(fd, "\"", 1);
}

void value_trace_(VAL val, int fd) {
    if (IS_INT(val)) {
        int_trace_(VINT(val), fd);
    } else if (IS_STR(val)) {
        str_trace_(VSTR(val), fd);
    } else if (IS_CONS(val)) {
        VAL car, cdr;
        value_uncons(val, &car, &cdr);
        write(fd, "[ ", 2);
        value_trace_(car, fd);
        write(fd, " ", 1);
        value_trace_(cdr, fd);
        write(fd, " ]", 2);
    } else {
        TRACE("value cannot be traced");
        exit(1);
    }
}

static void mw_prim_debug (void) {
    TRACE("??");
    for (long i = STACK_MAX-1; i >= (long)stack_counter; i--) {
        TRACE(" ");
        value_trace_(stack[i], 2);
    }
    TRACE("\n");
}

static void mw_prim_rdebug (void) {
    TRACE("call stack:\n");
    for (USIZE i = rstack_counter; i --> 1;) {
        TRACE("    ");
        if (rstack[i-1].atom && *rstack[i-1].atom && strcmp(rstack[i-1].atom, rstack[i].word)) {
            TRACE(rstack[i-1].atom);
            TRACE(" -> ");
        }
        TRACE(rstack[i].word);
        TRACE(" at ");
        TRACE(rstack[i-1].path);
        TRACE(":");
        int_trace_((int64_t)rstack[i-1].line, 2);
        TRACE(":");
        int_trace_((int64_t)rstack[i-1].col, 2);
        TRACE("\n");
    }
}

static void mw_prim_panic(void) {
    // TODO: expect less of the stack, i.e. panic gracefully even if stack
    // is in a weird state ... this is panic! after all
    VAL v = pop_value();
    ASSERT(IS_STR(v));
    ASSERT(VSTR(v)->size < SIZE_MAX);
    write(2,VSTR(v)->data, (size_t)VSTR(v)->size);
    mw_prim_debug();
    mw_prim_rdebug();
    exit(1);
}

